dba foglalt adatmennyiségeden felül. A kiegészítő opció minden hónapban megújul, így nem kell minden hónapban megrendelned újra. Az opciót a tarifádban vállalt előfizetési idő végéig csak kötbér ellenében mondhatod le, ami az ÁSZF 12.6.12 pontjában írtak szerint a kedvezményes opció havi előfizetési díjának a tarifáddal megvásárolható Plusz Adat havi díjához képest számított, igénybe vett kedvezménnyel azonos mértékű. A határozott idő lejártát követően a kedvezményes opciót kötbér nélkül bármikor lemondhatod.", "unLocalized": ""}}', 11);
