erzés, piackutatás és tájékoztatás céljára telefonon vagy egyéb elektronikus hírközlési úton (pl. SMS, MMS, e-mail), automatizált hívórendszeren keresztül, illetve postai úton felhasználja. Fenti hozzájárulás bármikor korlátozás és indokolás nélkül, ingyenesen visszavonható a Vodafone Magyarország Zrt. 1476 Budapest, Pf.: 350. postai és az ugyfelszolgalat.hu@vodafone.com elektronikus címeken keresztül. http://www.vodafone.hu/adatkezelesi-tajekoztato/adatkezeles-4gb.pdf", "unLocalized": ""}}', 11);
