INSERT INTO oscc_object VALUES (DEFAULT, 'O_PQREF_635c59', '{"PSMCodes": {"Activation": "TOLT 300MB"}, "Id": "O_PQREF_635c59", "Name": {"eng": "Shared PluszAdat 300 MB", "def": "Osztható PluszAdat 300 MB", "hun": "Osztható PluszAdat 300 MB", "unLocalized": ""}, "Description": {"eng": "This extra data pack will give you an additional 300MB of shared mobile internet for 750 Ft which you can use until your bill cycle, with the same conditions as your tariff. In case you have also contracted a MultiNet Supreme tariff, you will be able to share this extra data bundle between both your devices!", "def": "Ezzel a kiegészítő adatopcióval további 300MB adat áll rendelkezésedre a tarifádban foglalt adatmennyiségeden felül 750 Ft-ért, melyet számlazárásig tudsz felhasználni, a tarifádban foglalt adatra irányadó, azonos feltételekkel. Ha MultiNet Supreme szolgáltatással is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!", "hun": "Ezzel a kiegészítő adatopcióval további 300MB adat áll rendelkezésedre a tarifádban foglalt adatmennyiségeden felül 750 Ft-ért, melyet számlazárásig tudsz felhasználni, a tarifádban foglalt adatra irányadó, azonos feltételekkel. Ha MultiNet Supreme szolgáltatással is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!", "unLocalized": ""}, "Type": "One Time", "Price": "750", "Active": "true"}', 7);
INSERT INTO oscc_object VALUES (DEFAULT, '66975', '{"PSMCodes": {"Activation": "PLUSZ300MB-O-M", "Deactivation": "XPLUSZ300MB-O-M"}, "Id": "66975", "Name": {"eng": "Shared Recurring PluszAdat 300MB", "def": "Osztható Megújuló PluszAdat 300 MB", "hun": "Osztható Megújuló PluszAdat 300 MB", "unLocalized": ""}, "Description": {"eng": "This extra data pack will give you an additional 300MB of shared mobile internet in each monthly billing period (on top of the data already included in your tariff or Automatikus PluszAdat option) for 500 Ft. It will be activated every month at the start of your billing period so you don''t have to worry about purchasing extra data every month - after you run out! In case you have also contracted a MultiNet Supreme tariff, you will be able to share this extra data bundle between both your devices! You can use this extra data pack with the same conditions as your tariff.", "def": "Ezzel a kiegészítő adatopcióval 300MB osztható adat áll rendelkezésedre minden számlázási ciklusban havi 500 Ft-ért a tarifádban, valamit az Automatikus PluszAdat opciódba foglalt adatmennyiségeden felül. A kiegészítő opció minden hónapban megújul, így nem kell minden hónapban megrendelned újra. Ha MultiNet Supreme-el is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!  A kiegészítő adatopciót a tarifádban foglalt adat felhasználásával azonos feltételek mellett használhatod.", "hun": "Ezzel a kiegészítő adatopcióval 300MB osztható adat áll rendelkezésedre minden számlázási ciklusban havi 500 Ft-ért a tarifádban, valamit az Automatikus PluszAdat opciódba foglalt adatmennyiségeden felül. A kiegészítő opció minden hónapban megújul, így nem kell minden hónapban megrendelned újra. Ha MultiNet Supreme-el is rendelkezel, lehetőséged van megosztani a kiegészítő PluszAdatot a két eszközöd között!  A kiegészítő adatopciót a tarifádban foglalt adat felhasználásával azonos feltételek mellett használhatod.", "unLocalized": ""}, "Type": "recurringPR", "Price": "500", "Active": "true"}', 7);
