tt applikációkra, személyi használatra, utazási célra, a tarifában foglalt vagy vásárolt kiegészítő adatopció erejéig. A Video Pass automatikusan megújul minden hónapban,így nem kell havonta újrarendelned. A Video Pass a video szolgáltatást nyújtó harmadik fél által havidíj ellenében elérhető prémium funkcióik elérését nem tartalmazza, ezen fizetős tartalmak igénybevételéhez külön előfizetés szükséges a video szolgáltatónál. ", "unLocalized": ""}, "Price": "3372", "Name": {"def": "Video Pass", "eng": "Video Pass", "hun": "Video Pass", "unLocalized": ""}, "PSMCodes": {"Activation": "VIDEOPASSADDON", "Deactivation": "XVIDEOPASSADDON"}, "Featured": "false"}', 6);
